    false,nt"url": null,nt"notes": "This accession contains a scan of the analog
    publication 'TOGA Sea Level Center: Data from the Indian Ocean'. Abstract from p.
    iii of the publication:nnThe TOGA Sea Level Center has collected sea level data
    in the Indian Ocean from a network of island-based and coastal tide gauges, most
    of which have been recording since 1985. This network consists of stations of the
    Indo-Pacific Sea Level Network, which is a cooperative between the University of
    Hawaii and the host countries, and stations operatec by national agencies. A description
    of acquisition, quality contro, assessment, and the present contents of the data
    archive is provided. (Caldwell, Patrick, Shikiko Nakahara and Klaus Wirtki, 1990,
    TOGA Sea Level Center: Data from the Indian Ocean. JIMAR Contribution No. 91-233,
    Data Report No. 008. Joint Institute for Marine and Atmospheric Research, Univ.
